import{_ as t}from"./chunks/transform-popup.2c4383b3.js";import{_ as e}from"./chunks/chart-options.81bbd462.js";import{_ as s,c as o,o as a,a as r}from"./app.fe041d52.js";const n="/assets/visual-query-builder.86a591ba.png",i="/assets/join-table-popup.6b2d6ef0.png",l="/assets/filter-popup.a2e1cb7c.png",u="/assets/summarize-popup.969b2539.png",z=JSON.parse('{"title":"Visual Query Builder","description":"","frontmatter":{},"headers":[{"level":3,"title":"Data","slug":"data"},{"level":3,"title":"Filter","slug":"filter"},{"level":3,"title":"Summarize","slug":"summarize"},{"level":3,"title":"Transform","slug":"transform"},{"level":3,"title":"Visualize","slug":"visualize"}],"relativePath":"query/visual-query-builder.md","lastUpdated":1700671768000}'),h={name:"query/visual-query-builder.md"},c=r('<h1 id="visual-query-builder" tabindex="-1">Visual Query Builder <a class="header-anchor" href="#visual-query-builder" aria-hidden="true">#</a></h1><p>The visual query builder has 3 sections:</p><ul><li><strong>Build</strong>: The sidebar on the left is used to build the query. It has 3 sections: <ul><li><strong>Data</strong>: This section is used to select the data source and the table.</li><li><strong>Filter</strong>: This section is used to add filters to the query.</li><li><strong>Summarize</strong>: This section is used to select columns and perform aggregations on them.</li><li><strong>Transform</strong>: This section is used to perform transformations on the data, for example, pivot tables.</li></ul></li><li><strong>Chart</strong>: This section is used to display the visualization of the query.</li><li><strong>Result</strong>: This section is used to display the result of the query.</li></ul><p><img src="'+n+'" alt="Visual Query Builder"></p><h3 id="data" tabindex="-1">Data <a class="header-anchor" href="#data" aria-hidden="true">#</a></h3><p>The <strong>Data</strong> section is used to select the data source and the table. Clicking on the <strong>+</strong> button next to the <strong>Data</strong> section will open a popup to select the table.</p><p>To join multiple tables, click on the <strong>+</strong> button next to the <strong>Data</strong> section and select the table you want to join. Once you have selected the table, Insights will try to find the join condition automatically. If Insights is not able to find the join condition, you can select the join condition manually.</p><p><img src="'+i+'" alt="Join Table Popup"></p><h3 id="filter" tabindex="-1">Filter <a class="header-anchor" href="#filter" aria-hidden="true">#</a></h3><p>The <strong>Filter</strong> section is used to add filters to the query. You can add a filter by clicking on the <strong>+</strong> button next to the <strong>Filter</strong> section. You can add multiple filters to a query.</p><p>You can also write complex filters using the <strong>Expression</strong> tab in the filter popup. You can learn more about the available operators and functions in the <a href="#expressions">Expressions</a> section.</p><p><img src="'+l+'" alt="Filter Popup"></p><h3 id="summarize" tabindex="-1">Summarize <a class="header-anchor" href="#summarize" aria-hidden="true">#</a></h3><p>The <strong>Summarize</strong> section is used to select columns and perform aggregations on them. You can add a column by clicking on the <strong>+</strong> button next to the <strong>Summarize</strong> section.</p><p>By default, Insights will perform the aggregation based on the type of column selected. You can however change the aggregation type in the column popup.</p><p>You can also write complex aggregations using the <strong>Expression</strong> tab in the column popup. You can learn more about the available operators and functions in the <a href="#expressions">Expressions</a> section.</p><p><img src="'+u+'" alt="Summarize Popup"></p><h3 id="transform" tabindex="-1">Transform <a class="header-anchor" href="#transform" aria-hidden="true">#</a></h3><p>The <strong>Transform</strong> section is used to perform transformations on the data after the results are fetched from the database, for example, pivot on a column. You can add a transformation by clicking on the <strong>+</strong> button next to the <strong>Transform</strong> section.</p><p>Currently, Insights only supports pivot transformations on a set of result that has three columns and one of them is a number column.</p><p><img src="'+t+'" alt="Transform Popup"></p><p>You can checkout more on transformations in the <a href="#transformations">Transformations</a> section.</p><h3 id="visualize" tabindex="-1">Visualize <a class="header-anchor" href="#visualize" aria-hidden="true">#</a></h3><p>The <strong>Visualize</strong> tab is used to customize the visualization of the query. You can switch to the <strong>Visualize</strong> tab by clicking on the <strong>Visualize</strong> button next to the <strong>Build</strong> tab.</p><p>By default, Insights tries to guess the best visualization for the result set. You can however change the visualization type from the <strong>Chart Type</strong> dropdown.</p><p><img src="'+e+'" alt="Chart Options"></p><p>You can also <strong>Share</strong> the chart with a publicly accessible link and <strong>Add to Dashboard</strong> by clicking on the respective buttons above the chart.</p>',27),p=[c];function d(g,m,f,b,y,_){return a(),o("div",null,p)}const q=s(h,[["render",d]]);export{z as __pageData,q as default};
